import React, { useState, useEffect } from "react";
import { fetchContributions } from "../services/githubService";
import ContributionChart from "../components/ContributionChart";

const repositories = [
  "LobbyClientUI-R1",
  "LobbyAdminServerAPI-R1",
  "LobbyHeartbeatAutomationUI-R1",
  "HubspotIntegrationAPI-R1",
  "LobbyMiddlewareAPI-R1",
  "LobbyAdminPanelUI-R1",
  "LobbyServerAPI-R1",
];

const Dashboard = () => {
  const [selectedRepo, setSelectedRepo] = useState(repositories[0]);
  const [contributions, setContributions] = useState([]);

  useEffect(() => {
    fetchContributions(selectedRepo).then(setContributions);
  }, [selectedRepo]);

  return (
    <div>
      <h1>GitHub Contributions Dashboard</h1>
      <label>Select Repository: </label>
      <select
        value={selectedRepo}
        onChange={(e) => setSelectedRepo(e.target.value)}
      >
        {repositories.map((repo) => (
          <option key={repo} value={repo}>
            {repo}
          </option>
        ))}
      </select>
      <ContributionChart data={contributions} />
    </div>
  );
};

export default Dashboard;
